import React from 'react';



const Fetchpokemon = ({pokemons,urls}) => {
   <React.Strictmode>
    var pokemonid = [];
    urls.forEach((url)=>{
    	fetch(url)
    	.then(resp => resp.json())
    	.then(info=>console.log(info))

    })
    </React.Strictmode>

    return 1;
}



export default Fetchpokemon;
